import{_ as t,c as a,a2 as o,o as i}from"./chunks/framework.BQmytedh.js";const n="/assets/CreateDetailsPath.C4EW6-9K.png",r="/assets/CreateNavigationTreeRefresh.B-29RPjl.png",s="/assets/CreateItemDetailsCreateProject.DUcPDbOo.png",l="/assets/WebUploadForm.BwOCD2_H.png",c="/assets/WebUploadForm2.JYJ0hvwB.png",p="/assets/WebUploadForm3.C8aOXEkt.png",d="/assets/WebUploadForm4.Dpl8hp-q.png",k=JSON.parse('{"title":"Upload content using the web interface","description":"","frontmatter":{},"headers":[],"relativePath":"doc/guides/usage/uploading-content-to-create/using-web-interface.md","filePath":"doc/guides/usage/uploading-content-to-create/using-web-interface.md"}'),h={name:"doc/guides/usage/uploading-content-to-create/using-web-interface.md"};function u(m,e,g,f,b,y){return i(),a("div",null,e[0]||(e[0]=[o('<h1 id="upload-content-using-the-web-interface" tabindex="-1">Upload content using the web interface <a class="header-anchor" href="#upload-content-using-the-web-interface" aria-label="Permalink to &quot;Upload content using the web interface&quot;">​</a></h1><h2 id="paths" tabindex="-1">Paths <a class="header-anchor" href="#paths" aria-label="Permalink to &quot;Paths&quot;">​</a></h2><p>Any element within the Create module has an associated path to define its location in our filesystem structure.<br> You can check it by looking at the top of the <strong>Item Details</strong> form:</p><p><img src="'+n+'" alt="Element current path"></p><p>Paths work the same way as standard OS folder/file paths, so you can navigate them up/down and inside/out.<br> All paths start with a fixed string that contains the Username: <strong>/db/username</strong>. This is defined as the <strong>root</strong> of your path, so you can create the projects you need from here.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p><strong>Calculations are not allowed</strong> to be uploaded <strong>in the root path</strong> directly, they must be held inside a project.</p></div><h2 id="creating-a-project" tabindex="-1">Creating a project <a class="header-anchor" href="#creating-a-project" aria-label="Permalink to &quot;Creating a project&quot;">​</a></h2><p>Projects created in the root path are be called root projects. To create any, you must first clear the current path by clicking the <em>Refresh</em> button (find it on top on the Navigation Frame).</p><p><img src="'+r+'" alt="Refresh and reset path button"></p><p>With the current path cleared and set it to <em>root path</em>, you can start filling in the project details on the <em>Item Details</em> frame. <strong>Project name</strong> and <strong>description fields</strong> are mandatory.</p><p><img src="'+s+'" alt="Create project form, check root path on top"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>No symbol characters can be used in the project name (as they are not allowed either in directory names inside current OS).</p></div><p>When you are ready editing, then you must click on <em>Create project</em> button. <em>Navigation</em> Frame will refresh the workspace and your project will appear in the project hierarchy.</p><p>To create subprojects inside an existing project, you need to click on that project and replace its name and description in the <em>Item Details</em> frame. Then you click <em>Create project</em> and a new one will be generated inside the selected parent project.</p><h2 id="calculation-upload" tabindex="-1">Calculation upload <a class="header-anchor" href="#calculation-upload" aria-label="Permalink to &quot;Calculation upload&quot;">​</a></h2><p>To upload a calculation into a project you have to first click on that project. Then the Create web interface upper right panel will display a form where you can fill in the calculation name, its description etc.</p><p><img src="'+l+'" alt="Calculation upload form"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The <em>Name</em> field must not contain blank spaces or special characters like \\*@[]. otherwise it will be normalized to an underscore symbol.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Some specific calculations will require to upload the files in a certain order and/or append specific files in order to work properly, please refer the <a href="./using-shell-client/shell-automated-scripts.html">shell automated scripts</a> section for an extended desciption.</p></div><p>Then you have to select the specific format for file upload, which vary depending on the calculation type.</p><p><img src="'+c+'" alt="Calculation type selection"></p><p>Additional files can be attached; this is the case of the <em>Additional file</em> button. Such special option will display a form from where you can upload multiple files, add images, PDF files, and more.<br> Here is an example of this kind of form.</p><p><img src="'+p+'" alt="Multiple file upload form"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If you upload multiple files with the same name, the Create module will rename them using a numeric code, for example if you attach two <em>geometry.txt</em> files, the second one will be renamed as <em>geometry_2.txt</em>.</p></div><p>Now you can click on the <em>Load Calculation</em> button to start uploading your calculation.<br> A progress bar will appear in the lowest bottom right panel. Bear in mind that conveting and digesting big files can take while.</p><p><img src="'+d+'" alt="Upload queue status"></p><p>The progress bar will also display errors that migh occur during file upload.<br> You can click on the warning icon to display a longer explanation about the upload failure (keep it and it send it to us, please).</p><p>When all of your calculations are uploaded, you can click the <em>Refresh</em> button on the <em>Navigation</em> tab to refresh its content. Then, you can navigate throughout your newly uploaded data.</p>',28)]))}const _=t(h,[["render",u]]);export{k as __pageData,_ as default};
